100.80 s &lt;/li&gt;\n&lt;li&gt; transfer time: 276.93 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.7.0.141:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 120 &lt;/li&gt;\n          &lt;li&gt; Threads: 4800 &lt;/li&gt;\n          &lt;li&gt; Memory: 18.75 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+untagged.1.g608b984.dirty &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n###################################################################################################\n# Copyright (c) 2020-2022 Centre national de la recherche scientifique (CNRS)\n# Copyright (c) 2020-2022 Commissariat a l'\u00e9nergie atomique et aux \u00e9nergies alternatives (CEA)\n# Copyright (c) 2020-2022 Institut national de recherche en informatique et en automatique (Inria)\n# Copyright (c) 2020-2022 Universit\u00e9 Paris-Saclay\n# Copyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\n# from deisa import Deisa\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1085","type":"BasicTicker"},{"attributes":{"data":{"cpu":{"__ndarray__":"AAAAAAAALEAAAAAAAAAQQAAAAAAAADxAAAAAAAAAAEAAAAAAAAAoQAAAAAAAABhAAAAAAAAAOkAAAAAAAAAQQAAAAAAAACRAAAAAAAAAEEAAAAAAAAA6QAAAAAAAABhAAAAAAAAAJEAAAAAAAAAwQAAAAAAAAEFAAAAAAAAAGEAAAAAAAAAkQAAAAAAAABBAAAAAAAAAOkAAAAAAAAAQQAAAAAAAACRAAAAAAAAAIEAAAAAAAABAQAAAAAAAADBAAAAAAAAAJEAAAAAAAAAYQAAAAAAAADpAAAAAAAAAEEAAAAAAAAAgQAAAAAAAABhAAAAAAAAAPkAAAAAAAAAyQAAAAAAAACRAAAAAAAAAGEAAAAAAAAA4QAAAAAAAABBAAAAAAAAAJEAAAAAAAAAQQAAAAAAAAEBAAAAAAAAAKEAAAAAAAAAsQAAAAAAAABhAAAAAAAAAOEAAAAAAAAAYQAAAAAAAACRAAAAAAAAAEEAAAAAAAAA8QAAAAAAAACxAZmZmZmbmNUAAAAAAAAAQQAAAAAAAADhAAAAAAAAAAEAAAAAAAAAoQAAAAAAAABBAAAAAAAAAOEAAAAAAAAAgQAAAAAAAADZAAAAAAAAAGEAAAAAAAAA6QAAAAAAAABBAAAAAAAAAKEAAAAAAAAAQQAAAAAAAADxAAAAAAAAAEEAAAAAAAAAoQAAAAAAAABBAAAAAAAAAPEAAAAAAAAAQQAAAAAAA
